package hackerrank

import kotlin1.println
import kotlin.math.abs

/**
 * Sherlock and the Valid String
 *
 * https://www.hackerrank.com/challenges/sherlock-and-valid-string/problem
 */
class SherlockAndTheValidString {

    fun isValid(s: String): String {
        if (s.length <= 3) return "YES"
        val array = IntArray(26)
        s.toCharArray().forEach { it ->
            array[it - 'a'] += 1
        }
        var num1 = 0
        var num2 = 0
        var num1Counter = 0
        var num2Counter = 0
        array.forEach {
            if (it != 0) {
                if (num1 == 0 || it == num1) {
                    num1 = it
                    num1Counter++
                } else if (num2 == 0 || it == num2) {
                    num2 = it
                    num2Counter++
                } else {
                    // If got any third number
                    return "NO"
                }
            }
        }

        if (num1Counter > 1 && num2Counter > 1) {
            return "NO"
        }

        return if (num1 == 0 || num2 == 0 || (num1 == 1 && num1Counter <= 1) || (num2 == 1 && num2Counter <= 1) || (abs(num2 - num1) == 1)) {
            "YES"
        } else {
            "NO"
        }
    }
}


